import React from 'react';

export function Tile({object}) {
    const newArr = Object.values(object);

    return (
        <div>
            {
            newArr.map(element => {
                if(newArr.indexOf(element) === 0) {
                    return <p className='tile-title'>{element}</p>
                } else {
                    return <p className=''>{element}</p>
                }
            })
            }
        </div>
    );
}
